import React from "react";
import CommonHeader from "./CommonHeader";
import Title from "./Title";
import Footer from "./Footer";

const ContactUs=()=>{
    return <React.Fragment>
        <CommonHeader />
        <Title/>
        <Footer/>
    </React.Fragment>
}

export default ContactUs;
